import React, { Component } from 'react'; 
import './index.css';

export default class DailyGoalDisplay extends Component {
    render() {
        return(
            <div>
                <section>
                    <h1>Today's Goal: </h1>
                    <p>{this.props.goal}</p>

                    <h1>Planned Work Time: </h1>
                    <p>{this.props.time}</p>
                </section>
            </div>
        )
    }
}
